const Nav = (parametros) => {

    if(parametros.type == "header"){
        return (
            <nav>
                <a href="#">Tienda</a>
                <a href="#">Carrito</a>
                <a href="#">Contacto</a>
            </nav>
        )
    } else {
        return (
            <nav>
                <a href="#">link</a>
                <a href="#">link</a>
                <a href="#">link</a>
            </nav>
        )
    }
}

export default Nav
